import styled from "styled-components";

export const Foto = styled.img`
    width: 1920px;
    height: 600px;
    display: flex;
    align-self: center;
    background-image: url("src/assets/wallpaper dmc.jpg"); 
`;

export const Container = styled.div`
    width: 100%;
    height: auto;
`;
